import BaseService from './BaseService';
import {Config} from '../Config';
class DetailService {
    getDetail = params => BaseService.get(Config.webApi + 'item/'+ params);
    getRelatedProducts = params => BaseService.get(Config.webApi + 'item/company/'+ params);
}
const detailService = new DetailService();
export default detailService;
